import React from 'react';
import Card from '@material-ui/core/Card';
import CardActions from "@material-ui/core/CardActions";
import CardHeader from "@material-ui/core/CardHeader";
import CardContent from "@material-ui/core/CardContent";
import CardMedia from "@material-ui/core/CardMedia";
import makeStyles from "@material-ui/core/styles/makeStyles";
import {FlippingCard, FlippingCardBack, FlippingCardFront} from 'react-ui-cards'

const DP_width = 200;
const DP_height = 200;

const useStyles = makeStyles(theme => ({
    root: {
        flexGrow: 1,
    },
    card: {
        flexGrow: 1,
        display: 'flex',
        //minWidth: 700,
        //minHeight: 300,
        backgroundColor: "white"
    },
    flip_card: {
        minWidth: 700,
        minHeight: 380,
        backgroundColor: "white"
    },
    link_bar: {
        minWidth: 500,
        minHeight: 40,
        height: 40
    },
    media: {
        minWidth: DP_width,
        width: DP_width,
        minHeight: DP_height,
        height: DP_height,
    },
}))

export default function HobbiesPage() {
    const classes = useStyles();
    return (
        <div className={classes.root}>
            <FlippingCard className={classes.flip_card}>
                <FlippingCardBack className={classes.flip_card}>
                    <Card raised className={classes.card}>
                        <CardHeader title={"SpeedCubing"}/>
                        <CardMedia className={classes.media}
                                   title="SpeedCubing"
                                   image={require("../images/Cubing/Cubing_DP.jpg")}
                        />
                        <CardContent>
                            Hello
                        </CardContent>
                    </Card>

            </FlippingCardBack>
                <FlippingCardFront className={classes.flip_card}>
                    Front Content
                </FlippingCardFront>
            </FlippingCard>
            <Card raised className={classes.link_bar}>
                <CardContent>
                    Tags
                </CardContent>
            </Card>
        </div>
);
}
